import React, { useEffect, useRef, useState } from 'react';
import { makeStyles, useTheme } from '@mui/styles';
import { styled, alpha } from '@mui/material/styles';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import SearchIcon from '@mui/icons-material/Search';
import { Button, Grid, InputBase } from '@mui/material';

const useStyles = makeStyles(theme => ({
    icon: {
        color: theme.palette.background.darkGrey
    },
    recentSearchHeader: {
        backgroundColor: theme.palette.background.midGrey
    },
    mx2: {
        marginLeft: `${theme.spacing(2)} !important`,
        marginRight: `${theme.spacing(2)} !important`
    },
}));

function RecentSearch({ recentSearchList }) {
    const classes = useStyles();
    const location = useLocation();
    const navigate = useNavigate();

    const renderRow = searchItem => {
        return (
            <Grid container>
                {searchItem}
            </Grid>
        )
    }

    return (
        <Grid container justifyContent="flex-start" alignItems="center">
            <Grid container className={classes.recentSearchHeader}>Recent Search</Grid>
            {recentSearchList.map(item => renderRow(item))}
        </Grid>
    );
}

export default RecentSearch;
